  return (
    <div className="sidebar">
      <h3 className="sidebar-title">Messages</h3>
      <ConversationItem name="John Doe" lastMessage="Hey there!" />
      <ConversationItem name="Jane Smith" lastMessage="See you soon!" />
    </div>
  );
};

export default Sidebar;
